import React from "react";

class Children extends React.Component {
  render() {
    //console.log(this.props.sum(5)) // 7
    return (
      <div>
        <h1>{this.props.title}</h1>
        <p>{this.props.content}</p>
        <p>{this.props.information.name}</p>
      </div>
    )
  }
}

export default Children;
